import React from 'react';
import Card from './Card';

const CardList = ({name, url}) => {
    return (
        <div>
            {
                pokemonList.map(pokemon => {
                    return(
                        <Card key={name} name={name} url={url}/>
                    );
                })
            }
        </div>
    );
}

export default CardList;
